use crate::{Point, Color};

pub fn empty() -> u32 {
    0
}

#[inline]
pub fn hash(at: Point, color: Color) -> u32 {
    let index = 32 * at.y() + at.x();

    match color {
        Color::Black => unsafe { *TABLE.get_unchecked(index) },
        Color::White => unsafe { *TABLE.get_unchecked(1024 + index) },
    }
}

